  `adempimenti_successivi` enum('1','2','3','4','5','6','7') DEFAULT NULL COMMENT '1 = ANNUALITA SUCCESSIVA\n2 = PROROGA\n3 = CESSIONE\n4 = RISOLUZIONE\n5 = CONGUAGLIO DI IMPOSTA\n6 = SUBENTRO\n7 = RISOLUZIONE CON PAGAMENTO CONTESTUALE DEL RISPETTIVO',
